INSERT INTO `tbl_dms_datasource_data` VALUES ('1814', '17', 'ต่างด้าว(บุคคลที่มีปัญหาสถานะและสิทธิ)ที่ขึ้นทะเบียนกับกระทรวงมหาดไทย ในกลุ่มคนไร้รากเหง้า  (กลุ่มบุคคลที่ขาดบุพการีหรือบุพการีทอดทิ้งซึ่งอยู่นอกสถานรับเลี้ยงของรัฐ)  และมีเอกสารแบบพิมพ์ประวัติ ที่ไม่มีสถานะทางทะเบียนราษฎร์ ( ท.ร.38 ก.)  มีเลขประจำตัวประชาชนที่ขึ้นต้นด้วยเลข 0', '', '02');
INSERT INTO `tbl_dms_datasource_data` VALUES ('1815', '17', 'ต่างด้าว(บุคคลที่มีปัญหาสถานะและสิทธิ)ที่ขึ้นทะเบียนกับกระทรวงมหาดไทย ในกลุ่มคนที่มีคุณประโยชน์แก่ประเทศ ประเภททะเบียนราษฎร์ ท.ร.38 ก และมีเลขประจำตัวประชาชนที่ขึ้นต้นด้วยเลข 0', '', '03');
INSERT INTO `tbl_dms_datasource_data` VALUES ('1816', '17', 'ต่างด้าว(บุคคลที่มีปัญหาสถานะและสิทธิ)ที่เข้าเมืองโดยชอบด้วยกฎหมายในลักษณะชั่วคราว(ม.12,13,34,35 พ.ร.บ.คนเข้าเมือง พ.ศ. 2522) และคนต่างด้าวที่เข้าเมืองโดยไม่ชอบด้วยกฎหมาย(ม.17 พ.ร.บ.คนเข้าเมือง พ.ศ. 2522) ประเภททะเบียนราษฎร์ ท.ร. 13 มีเลข 13 หลัก และมีเลขประจำตัวประชาชนที่ขึ้นต้นด้วยเลข 6', '', '11');
